import React from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { 
  Activity, 
  GitBranch, 
  Zap, 
  Shield, 
  Users, 
  Clock,
  CheckCircle,
  AlertTriangle,
  XCircle
} from 'lucide-react';

interface ActivityItem {
  id: string;
  type: 'merge_request' | 'pipeline' | 'security' | 'ai_analysis' | 'system';
  title: string;
  description: string;
  timestamp: string;
  status: 'success' | 'warning' | 'error' | 'info';
  user?: string;
}

interface ActivityFeedProps {
  activities: ActivityItem[];
  isLoading?: boolean;
}

const activityIcons = {
  merge_request: GitBranch,
  pipeline: Zap,
  security: Shield,
  ai_analysis: Activity,
  system: Users
};

const statusIcons = {
  success: CheckCircle,
  warning: AlertTriangle,
  error: XCircle,
  info: Activity
};

const statusColors = {
  success: 'text-success-500',
  warning: 'text-warning-500',
  error: 'text-error-500',
  info: 'text-primary-500'
};

// Mock data for demonstration
const mockActivities: ActivityItem[] = [
  {
    id: '1',
    type: 'ai_analysis',
    title: 'MR Analysis Completed',
    description: 'Claude Sonnet 4 analyzed MR #1247 - Medium risk detected',
    timestamp: new Date(Date.now() - 30000).toISOString(),
    status: 'warning',
    user: 'AI Assistant'
  },
  {
    id: '2',
    type: 'pipeline',
    title: 'Pipeline Optimization',
    description: 'Build time reduced by 23% using AI recommendations',
    timestamp: new Date(Date.now() - 120000).toISOString(),
    status: 'success',
    user: 'System'
  },
  {
    id: '3',
    type: 'merge_request',
    title: 'New Merge Request',
    description: 'Feature/redis-cache branch ready for review',
    timestamp: new Date(Date.now() - 300000).toISOString(),
    status: 'info',
    user: 'sarah.chen'
  },
  {
    id: '4',
    type: 'security',
    title: 'Vulnerability Scan',
    description: '2 medium-risk vulnerabilities detected and patched',
    timestamp: new Date(Date.now() - 600000).toISOString(),
    status: 'warning',
    user: 'Security Bot'
  },
  {
    id: '5',
    type: 'system',
    title: 'Expert Recommendation',
    description: 'Suggested @mike.rodriguez for backend review',
    timestamp: new Date(Date.now() - 900000).toISOString(),
    status: 'info',
    user: 'Expert Finder'
  }
];

const formatTimeAgo = (timestamp: string) => {
  const now = new Date();
  const time = new Date(timestamp);
  const diffInSeconds = Math.floor((now.getTime() - time.getTime()) / 1000);

  if (diffInSeconds < 60) return `${diffInSeconds}s ago`;
  if (diffInSeconds < 3600) return `${Math.floor(diffInSeconds / 60)}m ago`;
  if (diffInSeconds < 86400) return `${Math.floor(diffInSeconds / 3600)}h ago`;
  return `${Math.floor(diffInSeconds / 86400)}d ago`;
};

export const ActivityFeed: React.FC<ActivityFeedProps> = ({
  activities = mockActivities,
  isLoading = false
}) => {
  return (
    <div className="glass-effect rounded-xl p-6 h-full">
      <div className="flex items-center gap-2 mb-6">
        <Activity className="w-5 h-5 text-primary-600" />
        <h2 className="text-lg font-semibold text-gray-900">Live Activity</h2>
        <div className="w-2 h-2 bg-success-500 rounded-full animate-pulse ml-auto" />
      </div>

      {isLoading ? (
        <div className="space-y-4">
          {[...Array(5)].map((_, i) => (
            <div key={i} className="animate-pulse">
              <div className="flex items-start gap-3">
                <div className="w-8 h-8 bg-gray-200 rounded-full" />
                <div className="flex-1">
                  <div className="h-4 bg-gray-200 rounded w-3/4 mb-2" />
                  <div className="h-3 bg-gray-200 rounded w-1/2" />
                </div>
              </div>
            </div>
          ))}
        </div>
      ) : (
        <div className="space-y-4 max-h-96 overflow-y-auto">
          <AnimatePresence>
            {activities.map((activity, index) => {
              const ActivityIcon = activityIcons[activity.type];
              const StatusIcon = statusIcons[activity.status];

              return (
                <motion.div
                  key={activity.id}
                  initial={{ opacity: 0, x: -20 }}
                  animate={{ opacity: 1, x: 0 }}
                  exit={{ opacity: 0, x: 20 }}
                  transition={{ duration: 0.3, delay: index * 0.1 }}
                  className="flex items-start gap-3 p-3 rounded-lg hover:bg-gray-50 transition-colors"
                >
                  <div className="relative">
                    <div className="w-8 h-8 bg-primary-100 rounded-full flex items-center justify-center">
                      <ActivityIcon className="w-4 h-4 text-primary-600" />
                    </div>
                    <div className={`absolute -bottom-1 -right-1 w-4 h-4 rounded-full bg-white flex items-center justify-center`}>
                      <StatusIcon className={`w-3 h-3 ${statusColors[activity.status]}`} />
                    </div>
                  </div>

                  <div className="flex-1 min-w-0">
                    <div className="flex items-center gap-2 mb-1">
                      <h3 className="text-sm font-medium text-gray-900 truncate">
                        {activity.title}
                      </h3>
                      <div className="flex items-center gap-1 text-xs text-gray-500">
                        <Clock className="w-3 h-3" />
                        {formatTimeAgo(activity.timestamp)}
                      </div>
                    </div>

                    <p className="text-sm text-gray-600 mb-1">
                      {activity.description}
                    </p>

                    {activity.user && (
                      <p className="text-xs text-gray-500">
                        by {activity.user}
                      </p>
                    )}
                  </div>
                </motion.div>
              );
            })}
          </AnimatePresence>
        </div>
      )}
    </div>
  );
};
